import React from "react";
import { useDispatch,useSelector} from 'react-redux'
import {getBreeds} from '../../Redux/Actions'
function Home(){
  const Breeds = useSelector(state => state.breeds)
  const dispatch = useDispatch();

  React.useEffect(()=>{
    dispatch(getBreeds())
  })

  return(
    <div>
      { Breeds?.map(e => (
        <h1> {e.name}</h1>
      ))}
     
    </div>
  )
}
export default Home;
